	async clickline()
	{
		const cV = this.app.workspace.getActiveFile()?.name;
		if(cV == null || !this.settings.notesToProcess.includes(cV.toString()))
		{
			return; //not on the list of files to process.
		}
		//new Notice("Current File: " + cV);
		const editor = this.app.workspace.getActiveViewOfType(MarkdownView)?.editor;		
		if(editor)
		{
			const cursor = editor.getCursor(); //checks if the coursor did click in the editor
			const lineText = editor.getLine(cursor.line); //get the line 

			// Count leading white spaces (including tabs)
  			const leadingWhitespaceCount = lineText.search(/\S/); //-1 means line is empty!

			if (cursor.line != this.cursorLine) //not in the same line
			{
				this.cursorLine = cursor.line;		
				this.cursorPosition = cursor.ch;		
			}
			else //this means the coursor is allready in the line
			{

				if(leadingWhitespaceCount >= 0) //line is not empty
				{
					// old - this was the try to have the click also in front - but i like if coursor is in line and click is at the end. if(this.cursorPosition <= (leadingWhitespaceCount+1) || cursor.ch >= lineText.length) //-1 line does not contain a "checkbox", 0 means its a level zero, any higher value means its indented
					if(cursor.ch >= lineText.length) //-1 line does not contain a "checkbox", 0 means its a level zero, any higher value means its indented
					{
						const firstNonWhitespaceChar = lineText[leadingWhitespaceCount];

						const sharpCount = (lineText.match(/#/g) || []).length;
						const exclemationmarkCount = (lineText.match(/!/g) || []).length;
						const scoredelta = Math.floor((sharpCount * this.settings.SharpPointValue + exclemationmarkCount * this.settings.ExclemationmarkPointValue) / (leadingWhitespaceCount+1) +1);

						//new Notice("Linetext: " + lineText + "    " + "indent: " + leadingWhitespaceCount + " !: " + exclemationmarkCount + " #: " + sharpCount + " means score of " + scoredelta);


						if(firstNonWhitespaceChar == this.completionMark) //is completed - but should now be rewerted (remove complition mark, and everything in between < >, than check if first digit is a integer to recalculate the score)
						{
							var revertedLineContent = lineText;
							revertedLineContent = revertedLineContent.replace(this.completionMark, "");
							revertedLineContent = revertedLineContent.replace(this.styleStart, "");
							revertedLineContent = revertedLineContent.replace(this.styleEnd, "");
							revertedLineContent = revertedLineContent + "\n";
							editor.replaceRange(revertedLineContent, { line: cursor.line, ch: 0 }, { line: cursor.line + 1, ch: 0 });

							// Set the cursor to the end of the reverted line
							const newCursorPosition = { line: cursor.line, ch: revertedLineContent.length-1 };
							editor.setCursor(newCursorPosition);

							// Set the cursor position after modification
							//const cursorAfter = { line: cursor.line, ch: cursor.ch };
							//editor.setCursor(cursorAfter);							
							
							this.updateHighscore(scoredelta*-1);
							//new Notice(`Score update with: -${scoredelta}`);

							
						}
						else //add a completion mark: . THAN add <span style="color: rgb(44, 63, 44);"> THAN the lineText (what was there bevor) THAN </span>, if the first digit was a number add to score
						{
							const lineWithoutWhiteSpaces = lineText.replace(/\t/g, '');
							var lineContent = '';
							for(var i = 0; i < leadingWhitespaceCount; i++)
							{
								lineContent += '\t';
							}
							lineContent += this.completionMark;
							lineContent += this.styleStart;
							lineContent += lineWithoutWhiteSpaces;
							lineContent += this.styleEnd;
							lineContent += ' \n';

							// Replace the entire line with the modified line
							editor.replaceRange(lineContent, { line: cursor.line, ch: 0 }, { line: cursor.line + 1, ch: 0 });

							// Get the new cursor position at the end of the modified line
							const newCursorPosition = { line: cursor.line, ch: lineContent.length-1 };
							editor.setCursor(newCursorPosition);
							
							// Set the cursor position after modification
							//const cursorAfter = { line: cursor.line, ch: cursor.ch };
							//editor.setCursor(cursorAfter);

							this.updateHighscore(scoredelta);
							//new Notice(`Score update with: ${scoredelta}`);

						}

						//new Notice(`clicked in current line left of text, first character: ${leadingWhitespaceCount} ${firstNonWhitespaceChar} ${secondNonWhitespaceChar}`);
					}
				}
				//new Notice(`click in line with the current coursor position! With whitespaces: ${leadingWhitespaceCount}`);
			}
		}
	}

