	//flash
	async CommonCelebration()
	{		
		//new Notice("Flash start");
		const view = this.app.workspace.getActiveViewOfType(MarkdownView);

		if(view)
		{
			const oldColor = view.contentEl.style.backgroundColor;			  

			const flashOverlay = document.createElement('div');
			flashOverlay.style.position = 'fixed';
			flashOverlay.style.top = '80%';
			flashOverlay.style.left = '50%';
			flashOverlay.style.transform = 'translate(-50%, -50%)'; // Center the overlay
			flashOverlay.style.width = '150%';
			flashOverlay.style.fontFamily = "Unborn";
			flashOverlay.style.height = '70px';
			flashOverlay.style.textAlign = 'center';
			flashOverlay.style.backgroundColor = "rgb(0, 0, 0)";
			flashOverlay.style.fontSize = '50px'; // Set the text size
			flashOverlay.style.color = "rgb(20, 160, 255)"; // Set the text color to white

			const randomIndex = Math.floor(Math.random() * this.settings.CommonCelebrationMsg.length);
			const msg = this.settings.CommonCelebrationMsg[randomIndex];
			flashOverlay.innerText = msg;
		  
			//view.containerEl.appendChild(flashOverlay);
			document.body.appendChild(flashOverlay);
		  
			// Restore the original background color after a short delay (e.g., 500 milliseconds)
			setTimeout(() => {
			// Remove the flash overlay before restoring the background color
			//view.containerEl.removeChild(flashOverlay);
			document.body.removeChild(flashOverlay);
			view.contentEl.style.backgroundColor = oldColor;
			}, 450);
		}
	}

